															<div class="description">
									<p><strong><em><span style="vertical-align: inherit;"><span style="vertical-align: inherit;">Yudabbiru</span></span></em></strong><span style="vertical-align: inherit;"><span style="vertical-align: inherit;"> merupakan kata yang terdapat dalam Al-Quran, ada beberapa kali kata</span></span><strong><em><span style="vertical-align: inherit;"><span style="vertical-align: inherit;"> Yudabbiru</span></span></em></strong><span style="vertical-align: inherit;"><span style="vertical-align: inherit;"> dinukilkan, salah satunya dalam QS. </span><span style="vertical-align: inherit;">Yunus (10) Ayat 3. Kata</span></span><strong><em><span style="vertical-align: inherit;"><span style="vertical-align: inherit;"> Yudabbiru</span></span></em></strong><span style="vertical-align: inherit;"><span style="vertical-align: inherit;"> merupakan</span><strong><em><span style="vertical-align: inherit;"> penyimpangan</span></em></strong><span style="vertical-align: inherit;"> dari kata&nbsp;</span></span><strong><em><span style="vertical-align: inherit;"><span style="vertical-align: inherit;"> dabbara</span></span></em></strong><span style="vertical-align: inherit;"><span style="vertical-align: inherit;"> (mengatur). </span><span style="vertical-align: inherit;">Namun</span></span><strong><span style="vertical-align: inherit;"><span style="vertical-align: inherit;"> Y </span></span><em><span style="vertical-align: inherit;"><span style="vertical-align: inherit;">udabbiru</span></span></em></strong><em>&nbsp;</em><span style="vertical-align: inherit;"><span style="vertical-align: inherit;"> diartikan secara luas adalah mengarahkan, mengelola, menjalankan, mengelola, atau mengurusi. </span><span style="vertical-align: inherit;">Arti</span></span><strong><em><span style="vertical-align: inherit;"><span style="vertical-align: inherit;"> Yudabbiru</span></span></em></strong><span style="vertical-align: inherit;"><span style="vertical-align: inherit;"> ini sejalan dengan istilah Administrasi umum yakni tata kelola.</span></span></p><br />
<p><span style="vertical-align: inherit;"><span style="vertical-align: inherit;">Yudabbiru Jurnal Administrasi Negara merupakan jurnal elektronik dan cetak yang telah melalui proses Peer- </span></span><em><span style="vertical-align: inherit;"><span style="vertical-align: inherit;">Review.&nbsp;</span></span></em><span style="vertical-align: inherit;"><span style="vertical-align: inherit;">Yudabbiru Jurnal Administrasi Negara dikelola oleh Laboratorium Program Studi Administrasi Negara, Fakultas Ilmu Sosial, Universitas Islam Kuantan Singingi dan diterbitkan oleh Lembaga Penelitian Pengabdian Kepada Masyarakat dan Dakwah Islamiyah.</span></span></p>
